import React from 'react';
import './sendpage.css';
function SendPage() {
    return (
      <div className="sendpage">
          <image src="https://upload.wikimedia.org/wikipedia/commons/3/3b/Men-at-work-148408.svg" width="100%" height="100%"></image>
      </div>
    );
  }

export default SendPage;
